function ConnectLicense ($product) {
    $hash = "n4dGdeUk8xxqC6ELCg1O";
    $domain = "www.phpshop.ru";
    $server = str_replace("www.", "", getenv('SERVER_NAME'));
    //@$fp = @fsockopen($domain, 80, $errno, $errstr);
    $Respon = null;
    if (! $fp) {
        //return exit("Ошибка соединения с сервером PHPShop");
    } else {
        fputs($fp, "GET /getlicense4.php?server=$server&product=" . urlencode($product) . "&hash=$hash  HTTP/1.0\r\n");
        fputs($fp, "Host: $domain\r\n");
        fputs($fp, "Connection: close\r\n\r\n");
        while (! feof($fp)) {
            $Respon .= fgets($fp, 1000);
        }
        $text = explode("<?generator?>", $Respon);
        $data = trim($text[1]);
        fclose($fp);
        if (strlen($data) < 100) {
            //header("Location: http://www.phpshop.ru/docs/error.html?SERVER_NAME=" . $_SERVER["SERVER_NAME"] . "&trial=off");
            //exit("Ошибка проверки лицензии для SERVER_NAME=" . $_SERVER["SERVER_NAME"] . ", HardwareLocked=" . $_SERVER["SERVER_ADDR"]);
        } else {
            @chmod("/license/", 0777);
            if (strstr($data, 'Trial'))
                $license_name = 'trial.lic';
            else
                $license_name = str_replace('.', '_', $server) . '.lic';
            @$fp = fopen("license/" . $license_name, "w+");
            if ($fp) {
                fputs($fp, $data);
                fclose($fp);
                @chmod("/license/", 0755);
                header("Location: " . $_SERVER["REQUEST_URI"]);
                //exit('Лицензия успешно создалась, обновите страницу...');
            } //else
                //exit("Внимание!<br>Ошибка записи ключа...<br>Задайте права доступа CMOD=777 для папки /license/ и повторите попытку.");
        }
    }
}

