function evalstr($str)
{
    ob_start();
    if (parser_function_guard == 'true') {
        if (! allowedFunctions($str[2]))
            return ob_get_clean();
    }
    if (eval(stripslashes($str[2])) !== NULL) {
        echo ('<center style="color:red"><br><br><b>PHPShop Template Code: В шаблоне обнаружена ошибка выполнения php</b><br>');
        echo ('Код содержащий ошибки:');
        echo ('<pre>');
        echo ($str[2]);
        echo ('</pre></center>');
        return ob_get_clean();
    }
    return ob_get_clean();
}

function allowedFunctions($str)
{
    $allowFunctions = array(
        'if',
        'else',
        'switch',
        'for',
        'foreach',
        'echo',
        'print',
        'print_r',
        'array',
        'isset',
        'empty',
        'chr',
        'str_replace',
        'empty'
    );
    $allowFunctions = array_merge($allowFunctions, explode(',', parser_function_allowed));
    preg_match_all('/\s*([A-Za-z0-9_$]+)\s*\(/isU', $str, $findedFunctions);
    $remElements = array_diff($findedFunctions[1], $allowFunctions);
    $denyFunctions = explode(',', parser_function_deny);
    foreach ($denyFunctions as $deny)
        if (stristr($str, $deny))
            $remElements[] = $deny;
    if (count($remElements) > 0) {
        echo ('<br><br><b>В шаблоне обнаружена запрещенная функция</b><br>');
        echo ('Список найденных запрещенных функций:');
        echo ('<pre>');
        foreach ($remElements as $remElement) {
            echo ($remElement . '()<br>');
        }
        echo ('</pre><br>');
        echo ('Список разрешенных функций (добавить свою функцию можно в config.ini секция [function]):');
        echo ('<pre>');
        foreach ($allowFunctions as $allowFunction) {
            echo ($allowFunction . '()<br>');
        }
        echo ('<br>');
        echo ('</pre><br>');
        return false;
    } else {
        return true;
    }
}

function newParser($string)
{
    global $SysValue;
    $newstring = @preg_replace_callback("/(@php)(.*)(php@)/sU", "evalstr", $string);
    $newstring = @preg_replace("/@([a-zA-Z0-9_]+)@/e", '$SysValue["other"]["\1"]', $newstring);
    return $newstring;
}

function Parser($string)
{
    return newParser($string);
}

function newGetFile($path)
{
    if (strpos($path, '.tpl')) {
        $file = @file_get_contents($path);
        if (! $file)
            return false;
        return $file;
    } else
        return false;
}

class PhpshopCrypt
{

    var $LicenseParse;

    var $CodeString;

    var $DecodeString;

    var $LicenseFlag;

    var $trial = true;

    function PhpshopCrypt($dir)
    {
        define("ProductName", "PHPSHOP 4.0 EE");
        $this->ParseIni($dir);
        $this->PhpshopCode();
        $this->PhpshopVersion();
        $this->PhpshopChek();
        $this->PhpshopServer();
        $this->PhpshopDomen();
        $this->PhpshopExpires();
        $this->ErrorLicense();
    }

    function PhpshopRebuild()
    {
        if (empty($_SESSION['PhpshopRebuild'])) {
            GetFile($clean = true);
            $_SESSION['PhpshopRebuild'] = true;
            header("Location: " . $_SERVER["REQUEST_URI"]);
            exit('Попытка пересоздать лицензию, обновите страницу...');
        }
    }

    function crc16($data)
    {
        $crc = 0xFFFF;
        for ($i = 0; $i < strlen($data); $i ++) {
            $x = (($crc >> 8) ^ ord($data[$i])) & 0xFF;
            $x ^= $x >> 4;
            $crc = (($crc << 8) ^ ($x << 12) ^ ($x << 5) ^ $x) & 0xFFFF;
        }
        return $crc;
    }

    function MySerial($LicenseParse)
    {
        $LicenseString = null;
        foreach ($LicenseParse as $key => $val)
            $LicenseString .= $key . '=' . $val . '&';
        $Code = base64_encode(md5(substr($LicenseParse['SupportExpires'], - 5) . $LicenseString . substr($LicenseParse['SupportExpires'], 0, 5)));
        $Serial = "EELIC-" . $this->crc16(substr($Code, 0, 5)) . "-" . $this->crc16(substr($Code, 5, 10)) . "-" . $this->crc16(substr($Code, 10, 15)) . "-" . $this->crc16(substr($Code, 15, 20)) . "-" . $this->crc16(substr($Code, 20, 25));
        return $Serial;
    }

    function ParseIni($dir)
    {
        $LicenseValue = @parse_ini_file($dir, 1);
        while (list ($key, $val) = @each($LicenseValue['License']))
            $LicenseParse[$key] = $val;
        $this->LicenseParse = $LicenseParse;
    }

    function ProductName($name)
    {
        return $name;
    }

    function PhpshopVersion()
    {
        if (ProductName != $this->ProductName($this->LicenseParse['ProductName']) and $this->LicenseParse['SupportExpires'] < time()) {
            $this->PhpshopRebuild();
            exit('Для использования этого файла требуется продлить техническую поддержку и получить новую лицензию для версии Enterprise 4.0');
        } elseif (ProductName != $this->ProductName($this->LicenseParse['ProductName']) and $this->LicenseParse['SupportExpires'] > time()) {
            $this->PhpshopRebuild();
            exit('Для использования этого файла требуется подать заявку на адрес <a href="mailto:mail@phpshop.ru">mail@phpshop.ru</a> для получения новой лицензии версии Enterprise 4.0');
        }
    }

    function PhpshopCode()
    {
        $LicenseParse = $this->LicenseParse;
        unset($LicenseParse['VerificationCode']);
        unset($LicenseParse['Serial']);
        $this->CodeString = $this->MySerial($LicenseParse);
        $this->LicenseParse['VerificationCode'] = $this->LicenseParse['Serial'];
    }

    function PhpshopChek()
    {
        if (($this->LicenseParse['VerificationCode'] != $this->CodeString) or (ProductName != $this->ProductName($this->LicenseParse['ProductName'])))
            $this->LicenseFlag = 1;
    }

    function PhpshopServer()
    {
        if ($this->LicenseParse['HardwareLocked'] != "No") {
            if (($this->LicenseParse['HardwareLocked'] != $_SERVER["SERVER_ADDR"])) {
                $this->LicenseFlag = 1;
            }
        }
    }

    function PhpshopDomen()
    {
        if ($this->LicenseParse['DomenLocked'] != "No")
            if ($this->LicenseParse['DomenLocked'] != getenv('SERVER_NAME'))
                if ("www." . $this->LicenseParse['DomenLocked'] != getenv('SERVER_NAME'))
                    $this->LicenseFlag = 1;
    }

    function ErrorLicense()
    {
        if ($this->LicenseFlag == 1) {
            $this->PhpshopRebuild();
            header("Location: http://www.phpshop.ru/docs/error.html?SERVER_NAME=" . getenv('SERVER_NAME') . "");
            exit("Ошибка проверки лицензии для SERVER_NAME=" . getenv('SERVER_NAME') . ", HardwareLocked=" . $_SERVER["SERVER_ADDR"]);
        }
    }

    function PhpshopExpires()
    {
        if ($this->LicenseParse['Expires'] != "Never")
            if ($this->LicenseParse['Expires'] <= date("U"))
                $this->LicenseFlag = 1;
    }

    function PhpshopCopyright()
    {
        return $this->LicenseParse['CopyrightEnabled'];
    }
}
