function GetFile($clean = false)
{
    $dir = './license';
    $true_lic = str_replace(array(
        'www.',
        '.'
    ), array(
        '',
        '_'
    ), getenv('SERVER_NAME')) . '.lic';
    if (file_exists($dir . chr(47) . $true_lic))
        return $dir . chr(47) . $true_lic;
    elseif (is_dir($dir))
        if ($dh = opendir($dir)) {
            while (($file = readdir($dh)) !== false) {
                if (empty($clean)) {
                    $fstat = explode(".", $file);
                    if ($fstat[1] == "lic")
                        return $dir . chr(47) . $file;
                } else
                    unlink($dir . chr(47) . $file);
            }
            closedir($dh);
        }
}

